1º.- LAS ACTIVIDADES PROPIAS DE UNA EMPRESA CONSTRUCTORA Y DE COMERCIALIZACIÓN DE LA CONSTRUCCIÓN ENTRE LAS QUE SE SEÑALAN EXPRESAMENTE LAS SIGUIENTES: A) ADQUISICIÓN, TENENCIA, EXPLOTACIÓN, GRAVAMEN, DISFRUTE Y ENAJENACIÓN, POR CUALQUIERA DE LAS MODALIDADES ADMITIDAS EN DERECHO, DE EDIFICIOS, SOLARES Y TODA CLASE DE INMUEBLES RÚSTICOS Y URBANOS. B) CONSTRUCCIÓN DE EDIFICIOS DE TODO GÉNERO ACOGIDOS O NO A LAS LEYES ESPECIALES O PROTECTORAS Y LA EXPLOTACIÓN DE LOS MISMOS DIRECTAMENTE, EN RÉGIMEN DE ARRENDAMIENTO O SU ENAJENACIÓN. C) CONTRATACIÓN DE LA EJECUCIÓN DE TODA CLASE DE OBRAS O PRESTACIÓN DE SERVICIOS INMOBILIARIOS, YA SEA PARA LLEVAR A TÉRMINO DE POR SÍ LOS CONTRATOS O PARA CEDERLOS A UN TERCERO TOTAL O PARCIALMENTE. D) URBANIZACIÓN DE ZONAS Y SOLARES, DOTÁNDOLOS DE TODOS O PARTE DE LOS SERVICIOS NECESARIOS Y ÚTILES. E) CONTRATAR LA EJECUCIÓN DE OBRAS DEL ESTADO, COMUNIDADES AUTÓNOMAS, PROVINCIAS Y MUNICIPIOS TANTO EN Y DE ESPAÑA COMO DE Y EN EL EXTRANJERO, PARTICULARMENTE DE Y EN LA COMUNIDAD EUROPEA, CUALQUIERA QUE SEA SU ÍNDOLE. ENTRE LAS MISMAS Y SOLO POR VÍA EJEMPLIFICATIVA SE CITAN LAS SIGUIENTES: I.- MOVIMIENTOS DE TIERRA Y PERFORACIONES COMPRENDIÉNDOSE ENTRE ELLAS LAS QUE A CONTINUACIÓN SE EXPRESAN: I.- DESMONTES Y VACIADOS II.- EXPLANACIONES. III.- CANTERAS. IV.- POZOS Y GALERÍAS V.- TÚNELES. II.- EDIFICACIONES Y URBANIZACIONES, COMPRENDIÉNDOSE ENTRE ELLAS LAS QUE A CONTINUACIÓN SE EXPRESAN: I.- DEMOLICIONES. II.- ESTRUCTURAS DE FÁBRICA Y HORMIGÓN. III.- ESTRUCTURAS METÁLICAS. IV.- ALBAÑILERÍA, REVOCOS Y REVESTIDOS. V.- AISLAMIENTOS E IMPERMEABILIZACIONES. VI.- CARPINTERÍA DE MADERA. VII.- CARPINTERÍA METÁLICA.III.- FERROCARRILES, COMPRENDIÉNDOSE ENTRE ELLAS LAS QUE A CONTINUACIÓN SE EXPRESAN: I.- TENDIDO DE VÍAS. II.- ELEVADOS SOBRE CARRIL O CABLE. III.- SEÑALIZACIONES Y ENCLAVAMIENTOS. IV.- ELECTRIFICACIÓN DE FERROCARRILES. V.-OBRAS DE FERROCARRIL SIN CUALIFICACIÓN ESPECÍFICA. IV.- VIALES Y PISTAS, COMPRENDIÉNDOSE ENTRE ELLAS LAS QUE A CONTINUACIÓN SE EXPRESAN: I.- AUTOPISTAS, AUTOVÍAS Y CARRETERAS. II.- PISTAS DE ATERRIZAJE. III.- FIRMES DE HORMIGÓN HIDRÁULICO. IV.- FIRMES DE MEZCLAS BITUMINOSAS. V. SEÑALIZACIONES Y BALIZAMIENTOS VIALES. VI.- OBRAS VIALES SIN CUALIFICACIÓN ESPECÍFICA.&#13;
V.- INSTALACIONES ELÉCTRICAS Y ELECTRÓNICAS COMPRENDIÉNDOSE ENTRE ELLAS LAS QUE A CONTINUACIÓN SE EXPRESAN: I.- ALUMBRADOS, ILUMINACIONES Y BALIZAMIENTOS LUMINOSOS. II.- CENTRALES DE PRODUCCIÓN DE ENERGÍA. III.- LÍNEAS ELÉCTRICAS DE TRANSPORTE. IV.- CENTROS DE TRANSFORMACIÓN E INTERCONEXIÓN. V.- DISTRIBUCIONES DE BAJA TENSIÓN. VI.- TELECOMUNICACIONES E INSTALACIONES RADIOELÉCTRICAS. VII.- INSTALACIONES ELÉCTRICAS SIN CUALIFICACIÓN ESPECÍFICAS. VIII.- INSTALACIONES ELECTRÓNICAS. IX.- LÍNEAS AÉREAS DE CONTACTO. X.- INSTALACIONES DE SEGURIDAD. XI SEÑALIZACIONES Y ENCLAVAMIENTOS FERROVIARIOS. XI.- LAS ACTIVIDADES PROPIAS DE UN NEGOCIO DE CONSERVACIÓN, MANTENIMIENTO Y REPARACIÓN ELÉCTRICAS Y ELECTRÓNICAS. XII.- LA CONSTRUCCIÓN DE ESTRUCTURAS DE FÁBRICA U HORMIGÓN.&#13;
XIII.- LA EJECUCIÓN DE INSTALACIONES DE CALEFACCIÓN Y/O VENTILACIÓN Y/O CLIMATIZACIÓN.&#13;
LA VENTA AL POR MAYOR Y DETAL DE TODA CLASE DE APARATOS ELÉCTRICOS, ELECTRODOMÉSTICOS Y ELECTRÓNICOS. F).- ADQUISICIÓN, TENENCIA Y EXPLOTACIÓN DE FINCAS AGRÍCOLAS Y GANADERAS, PROPIAS O AJENAS, TANTO EN RÉGIMEN DE CULTIVO DE SECANO O DE REGADÍO, COMPRENDIÉNDOSE ENTRE LAS MENCIONADAS ACTIVIDADES LAS QUE A CONTINUACIÓN SE EXPRESAN: I.- INDUSTRIALIZACIÓN DE LOS PRODUCTOS DEL CAMPO Y GANADEROS. II.- COMERCIALIZACIÓN DE LOS PRODUCTOS AGROPECUARIOS.&#13;
G).- INSTALACIÓN, MANTENIMIENTO, REPARACIÓN Y CONSERVACIÓN DE INSTALACIONES DE FONTANERÍA, GAS Y CONDUCCIONES DE AGUA. 2º.- LA LIMPIEZA, RECOGIDA DE BASURAS Y MANTENIMIENTO DE EDIFICIOS E INTERIORES ASÍ COMO DE TODO TIPO DE ESPACIOS PÚBLICOS Y PRIVADOS. 3º.- LA PRESTACIÓN DE SERVICIOS DE ALCANTARILLADO, EVACUACIÓN Y DEPURACIÓN DE AGUAS. 4º.- LA PRESTACIÓN DE SERVICIOS DE CONTROL DE PLAGAS Y EXTERMINIO DE ANIMALES INTRUSOS Y DAÑINOS. 5º.- GESTIÓN, CONSERVACIÓN, MANTENIMIENTO Y EXPLOTACIÓN DE APARCAMIENTOS PRIVADOS Y PÚBLICOS, BIEN DIRECTAMENTE O EN RÉGIMEN DE CONCESIÓN ADMINISTRATIVA POR PARTE DE LAS DIFERENTES ADMINISTRACIONES PÚBLICAS, AUTONÓMICAS Y LOCALES. 6º.- LAS ACTIVIDADES COMPLEMENTARIAS DE EJECUCIÓN DE OBRAS PÚBLICAS TALES COMO EXPLOTACIÓN DE CANTERAS DE CUALQUIER CLASE, LA EXPLOTACIÓN DE PLANTAS DE AGLOMERADO, EN FRÍO O CALIENTE, Y HORMIGONES, Y LA DE EXPLOTACIÓN COMO PROPIETARIO, ARRENDADORA O ARRENDATARIA DE MÁQUINAS ESPECIALES DESTINADAS A LA EJECUCIÓN DE OBRAS PÚBLICAS, INCLUSO LA ACTIVIDAD DE TRANSPORTE. 7º.- LA ADQUISICIÓN, ACOPIO, VENTA, DISTRIBUCIÓN O REPRESENTACIÓN, PARA SÍ, PARA SUS ASOCIADOS O TERCEROS, DE PRODUCTOS, MAQUINARIAS O HERRAMIENTAS, RELACIONADAS CON LAS ACTIVIDADES ANTERIORMENTE MENCIONADAS, PUDIENDO REALIZAR ESTA ACTIVIDAD EXPORTANDO O IMPORTANDO PRODUCTOS. 8º.- LA GESTIÓN, EXPLOTACIÓN Y MANTENIMIENTO DE SERVICIOS DE DISTRIBUCIÓN, TRATAMIENTOS Y DEPURACIÓN DE AGUA, TANTO PRIVADO COMO NO PRIVADO, CUALQUIERA QUE SEA SU ORIGEN, CLASE Y DESTINO; INCLUYENDO PLANTAS DE TRATAMIENTO Y DEPURACIÓN, ESTACIONES DE BOMBEO, REDES DE DISTRIBUCIÓN Y SANEAMIENTOS, ALCANTARILLADO, EMISARIOS Y SUBMARINOS, REDES DE RIEGO, ASÍ COMO EL SUMINISTRO DE PRODUCTOS ADITIVOS Y MATERIALES DIVERSOS Y NECESARIOS PARA ELLO, Y EN GENERAL, MANTENIMIENTO DE EQUIPO MECÁNICO Y ELÉCTRICO. 9º.- LA GESTIÓN, EXPLOTACIÓN Y MANTENIMIENTO DE SERVICIOS DE TRATAMIENTOS, RECOGIDA Y VALORACIÓN DE RESIDUOS SÓLIDOS TANTO URBANOS COMO INDUSTRIALES, INCLUYENDO PLANTAS DE TRATAMIENTO Y POSTERIOR APLICACIÓN Y COMERCIALIZACIÓN DE SUBPRODUCTOS. 10º.- EL APROVECHAMIENTO, TRANSFORMACIÓN Y COMERCIALIZACIÓN DE TODA CLASE DE AGUAS, ASÍ COMO LA REUTILIZACIÓN DIRECTA O MEDIANTE TRANSFORMACIÓN Y TRANSPORTE DE LAS AGUAS Y SUS SUBPRODUCTOS. 11º.- LA REALIZACIÓN DE ESTUDIOS Y DIAGNÓSTICOS, INVESTIGACIÓN, AUDITORÍA DE TRABAJOS Y CONTROL Y ACTUACIÓN MEDIOAMBIENTAL.&#13;
LA REALIZACIÓN DE PROYECTOS, DIRECCIÓN TÉCNICA Y SEGUIMIENTO DE OBRAS REFERENTES A PLANTAS DE TRATAMIENTOS Y DEPURACIÓN, ESTACIONES DE BOMBEO, REDES DE DISTRIBUCIÓN, RIEGO Y SANEAMIENTO, EMISARIOS SUBMARINOS Y PLANTAS DE RECOGIDA Y TRATAMIENTO TANTO DE AGUA COMO DE RESIDUOS SÓLIDOS, ASÍ COMO DE SUS SUBPRODUCTOS. 12º.- LA REALIZACIÓN DE OBRAS DE CONSTRUCCIÓN, MEJORA Y AMPLIACIÓN DE LAS INSTALACIONES CORRESPONDIENTES A LAS ACTUACIONES DESCRITAS EN EL PUNTO ANTERIOR, INCLUYENDO CONSTRUCCIÓN Y SUMINISTRO DE EQUIPO Y MATERIALES. 13º.-LA PRESTACIÓN DIRECTA O INDIRECTA DE SERVICIOS DE CONSERVACIÓN Y MANTENIMIENTO INTEGRAL DE BIENES INMUEBLES, ASÍ COMO DE LOS EQUIPOS E INSTALACIONES INCLUIDOS EN EL MISMO. 14º.- ACTIVIDADES PROPIAS DE JARDINERÍA, ASÍ COMO DE REPOBLACIONES FORESTALES. 15º.- A) LA COMPRA, PROMOCIÓN, CONSTRUCCIÓN, REHABILITACIÓN, ARRENDAMIENTO Y VENTA DE BIENES INMUEBLES. B) LA URBANIZACIÓN DE TERRENOS, ASÍ COMO LA REDACCIÓN, TRAMITACIÓN Y EJECUCIÓN DE PROYECTOS Y PLANES DE ORDENACIÓN URBANA DE TERRENOS SUSCEPTIBLES DE ELLO. 16º.- LA PRESTACIÓN DIRECTA O INDIRECTA DE SERVICIOS DE GESTIÓN, INCLUIDOS LOS DE ESPECTÁCULOS PÚBLICOS, ASÍ COMO DE CONSERVACIÓN Y MANTENIMIENTO INTEGRAL Y EXPLOTACIÓN DE LOS BIENES INMUEBLES NECESARIOS PARA EL DESARROLLO Y REALIZACIÓN DE LOS MISMOS Y, EN GENERAL DE TODA CLASE DE SERVICIOS PÚBLICOS Y PRIVADOS. 17º.- CONSTRUCCIÓN, EXPLOTACIÓN Y GESTIÓN DE TODO TIPO DE ESTABLECIMIENTOS DEDICADOS A LA HOSTELERÍA, RESTAURACIÓN, ACTIVIDADES DEPORTIVAS, PARQUES DE ATRACCIONES Y, EN GENERAL, DE CUALQUIER OTRA ACTIVIDAD RELACIONADA CON EL OCIO, EL DEPORTE, LA RECREACIÓN. 18º.- DISEÑO, CONSTRUCCIÓN, EJECUCIÓN, EXPLOTACIÓN, GESTIÓN, ADMINISTRACIÓN, CONSERVACIÓN DE TODA CLASE DE INFRAESTRUCTURAS Y OBRAS, YA SEA DIRECTAMENTE O A TRAVÉS DE LA PARTICIPACIÓN EN SOCIEDADES, AGRUPACIONES, CONSORCIOS O CUALQUIER OTRA FIGURA JURÍDICA ANÁLOGA LEGALMENTE PERMITIDA EN EL PAÍS QUE SE TRATE. 19º.- EXPLOTACIÓN Y PRESTACIÓN DE TODO TIPO DE SERVICIOS RELACIONADOS CON LA INFRAESTRUCTURA DEL TRANSPORTE URBANO E INTERURBANO, YA SEA POR VÍA TERRESTRE, MARÍTIMA O AÉREA. 20º.- EXPLOTACIÓN Y GESTIÓN DE TODA CLASE DE OBRAS Y SERVICIOS COMPLEMENTARIOS QUE PUEDAN OFRECERSE EN LAS ÁREAS DE INFLUENCIA DE INFRAESTRUCTURAS Y OBRAS, PÚBLICAS Y PRIVADAS. 21º.- LA TITULARIDAD DE TODA CLASE DE CONCESIONES, SUBCONCESIONES, AUTORIZACIONES Y LICENCIAS ADMINISTRATIVAS DE OBRAS, SERVICIOS Y MIXTAS DEL ESTADO, COMUNIDADES AUTÓNOMAS, PROVINCIAS, MUNICIPIOS, ORGANISMOS AUTÓNOMOS, ENTIDADES AUTÓNOMAS Y, EN GENERAL, CUALQUIER ESTADO O ADMINISTRACIÓN PÚBLICA EXTRANJEROS, ORGANISMOS E INSTITUCIONES INTERNACIONALES. 22º.- LA PRESTACIÓN DE SERVICIOS DE ASISTENCIA EN TIERRA DE LOS AEROPUERTOS CONOCIDO COMO HANDLING, INCLUYENDO LA ASISTENCIA EN TIERRA A LAS AERONAVES, PASAJEROS, MERCANCÍAS, EQUIPAJES Y CORREO; LOS SERVICIOS DE OPERACIONES DE PISTA, DE LIMPIEZA Y DE ASISTENCIA DE COMBUSTIBLE, Y EN GENERAL LAS ACTIVIDADES COMPRENDIDAS EN EL HANDLING&#13;
